import React from 'react';
import { Component } from 'react';
import Cards from '../Component/Cards';
import Button from '../Component/Button';

function Body() {
    return (
        <div class = "Body container" styles="padding-top: 5px">
            <p><br /></p>
            <Button/>
            <p><br /></p>
            <Cards/>
        </div>
    );
}
export default Body
